import styled from "styled-components";
import React from "react";
import ReactDOM from "react-dom";

const Sc_img = styled.img`
  width: 200px;
  height: 200px;
`;
const Sc_div = styled.div`
  width: 60%;
  margin: 10px auto;
  text-align: center;
`;

function Foods(props) {
  const { data } = props;
  return (
    <Sc_div className="foods">
      {data.map((items) => (
        <Sc_img src={items.img} />
      ))}
    </Sc_div>
  );
}

export default Foods;
